snippet.description:
Quest'anno abbiamo pensato di fare qualcosa di diverso. Lo facciamo ogni anno, anche se non da sempre, ma la sostanza rimane la stessa: una classifica dei migliori e dei peggiori giochi dell'anno in corso, nell'attesa di una lista dei giochi più attesi per l'anno successivo.
Questo 2025 è stato pieno di belle uscite. Non possiamo lamentarci...
